const BUTTON_SIZE = 40;
const MARGIN_RIGHT = 10;
const MARGIN_LEFT = 10;

const getDefaultStyle = isLight => ({
  color: isLight ? 'rgba(0, 0, 0, 0.8)' : '#fff',
});

export { BUTTON_SIZE, getDefaultStyle, MARGIN_RIGHT, MARGIN_LEFT };
